import React from "react";
import {} from 'react-'


function Login() {
  return (
    <div>
        <h1>LOGIN</h1>
      <form action="">
        <input type="email" placeholder="EMAIL" />
        <input type="password" placeholder="PASSWORD" />
        <button>LOGIN</button>
      </form>
    </div>
  );
}

export default Login;
